  var height = polygonGeometry._height;
  var extrudedHeight = polygonGeometry._extrudedHeight;
  var extrude =
    polygonGeometry._perPositionHeightExtrude ||
    !CesiumMath.equalsEpsilon(height, extrudedHeight, 0, CesiumMath.EPSILON2);
